import React, { Component } from "react";

class Title extends Component {
  constructor(props) {
    super(props);
    this.cont = 0;
    this.name = "Luis";
  }

  sumar() {
    this.cont += 1;
    console.log(this.cont);
    return this.cont;
  }

  render() {
    return (
      <div className="center">
        <h2>{this.cont}</h2>
        <button onClick={this.sumar()}>+</button>
      </div>
    );
  }
}

export default Title;
